/*
** EPITECH PROJECT, 2020
** B-DEV-500-PAR-5-1-cardgames-lucas.guyader
** File description:
** JsonFile.js
*/

import React, { Component } from "react";
import About from "../about.json";

class JsonFile extends Component {
    constructor(props) {
      super(props);
      this.state = {
        jsonFile: 0
      };
    }
    render() {
        return (
            <div>
                <ul>
                    {About.map((postDetail, index) => {
                        return <p>{postDetail["client "]}</p>
                    })}
                    {About.map(s => (<li>{s}</li>))}
                </ul>
            </div>
        );
    }
}

export default JsonFile;
